import React from 'react';
import './App.css';

function App() {
  // Mock user data for demo
  const user = { name: "Student", role: "student" };
  
  // Mock functions for buttons
  const handleLogin = () => {
    alert('Login button clicked! This would open login page.');
    window.location.href = '/#/login';
  };

  const handleEvents = () => {
    alert('Opening Events page!');
    window.location.href = '/#/events';
  };

  const handleRegistrations = () => {
    alert('Opening My Registrations page!');
    window.location.href = '/#/registrations';
  };

  const handleProfile = () => {
    alert('Opening Profile page!');
    window.location.href = '/#/profile';
  };

  const handleContact = () => {
    alert('Opening Contact page!');
    window.location.href = '/#/contact';
  };

  const handleRegisterEvent = () => {
    alert('Registering for event! This would connect to backend.');
  };

  return (
    <div className="app">
      {/* Navigation */}
      <nav className="navbar">
        <div className="nav-container">
          <div className="nav-logo">üé™ EventHub</div>
          <div className="nav-menu">
            <a href="#home" className="nav-link" onClick={(e) => { e.preventDefault(); window.location.href = '/'; }}>Home</a>
            <a href="#events" className="nav-link" onClick={(e) => { e.preventDefault(); handleEvents(); }}>Events</a>
            <a href="#registrations" className="nav-link" onClick={(e) => { e.preventDefault(); handleRegistrations(); }}>My Registrations</a>
            <span className="user-info">Welcome, {user.name}</span>
            <button className="logout-btn" onClick={handleLogin}>
              {user ? 'Logout' : 'Login'}
            </button>
          </div>
        </div>
      </nav>

      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1 className="hero-title">
            Welcome to <span className="gradient-text">EventHub</span>
          </h1>
          <p className="hero-subtitle">
            Discover amazing events, register with ease, and never miss out on the action. {user && `Welcome back, ${user.name}!`}
          </p>
          <div className="hero-stats">
            <div className="stat">
              <h3>50+</h3>
              <p>Events</p>
            </div>
            <div className="stat">
              <h3>1000+</h3>
              <p>Students</p>
            </div>
            <div className="stat">
              <h3>95%</h3>
              <p>Satisfaction</p>
            </div>
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section className="features">
        <h2 className="section-title">What would you like to do?</h2>
        <div className="features-grid">
          <div className="feature-card" onClick={handleEvents}>
            <div className="feature-icon">üìÖ</div>
            <h3>Browse Events</h3>
            <p>Explore upcoming events with details like date, venue, and rules.</p>
            <button className="feature-btn" onClick={handleEvents}>View Events</button>
          </div>

          <div className="feature-card" onClick={handleRegistrations}>
            <div className="feature-icon">üé´</div>
            <h3>My Registrations</h3>
            <p>Check the events you have registered for and manage participation.</p>
            <button className="feature-btn" onClick={handleRegistrations}>View Registrations</button>
          </div>

          <div className="feature-card" onClick={handleProfile}>
            <div className="feature-icon">üë§</div>
            <h3>Profile</h3>
            <p>Update your account information and keep details up to date.</p>
            <button className="feature-btn" onClick={handleProfile}>Go to Profile</button>
          </div>

          <div className="feature-card" onClick={handleContact}>
            <div className="feature-icon">üí¨</div>
            <h3>Help & Support</h3>
            <p>Need assistance? Contact the support team anytime.</p>
            <button className="feature-btn" onClick={handleContact}>Contact Us</button>
          </div>
        </div>
      </section>

      {/* Quick Actions */}
      <section className="quick-actions">
        <h2 className="section-title">Quick Actions</h2>
        <div className="action-buttons">
          <button className="action-btn primary" onClick={handleEvents}>
            üé™ Browse All Events
          </button>
          <button className="action-btn secondary" onClick={handleRegistrations}>
            üìã My Registrations
          </button>
          <button className="action-btn success" onClick={handleRegisterEvent}>
            üìù Register for Event
          </button>
        </div>
      </section>

      {/* Demo Events Section */}
      <section className="demo-events">
        <h2 className="section-title">Demo Events</h2>
        <div className="events-grid">
          <div className="event-card">
            <h3>üé§ Music Festival 2024</h3>
            <p>Join us for the biggest music event of the year!</p>
            <button className="register-btn" onClick={handleRegisterEvent}>
              Register Now
            </button>
          </div>
          <div className="event-card">
            <h3>üíª Tech Conference</h3>
            <p>Learn about the latest in technology and innovation.</p>
            <button className="register-btn" onClick={handleRegisterEvent}>
              Register Now
            </button>
          </div>
          <div className="event-card">
            <h3>‚öΩ Sports Tournament</h3>
            <p>Annual inter-college sports competition.</p>
            <button className="register-btn" onClick={handleRegisterEvent}>
              Register Now
            </button>
          </div>
        </div>
      </section>

      <footer className="footer">
        <p>¬© 2024 EventHub | Buttons are now working! üéâ</p>
      </footer>
    </div>
  );
}

export default App;
